Object.Field:
declare
cursor c_OptRoute is select  SITE_ID,OPTIMIZED_ROUTE_ID from staging_rota_site WHERE DEPOT_ID= '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT';
c6 cs_rota_read_site.optimizedroute_id%type;
c5 cs_rota_read_site.siteid%type;
BEGIN
open c_OptRoute;
LOOP
  fetch c_OptRoute into c5,c6;
  exit when c_OptRoute%NOTFOUND;

  update CS_ROTA_READ_SITE SET cs_rota_read_site.OPTIMIZEDROUTE_ID = c6
  WHERE cs_rota_read_site.siteid=c5;

  END LOOP;
commit;
  CLOSE c_OptRoute;
END;

DECLARE
  site_count_base      NUMBER:=0;
  site_count_optimized NUMBER:=0;
  lv_error             VARCHAR2(25):='';
  CURSOR c_read_route
  IS
    SELECT DISTINCT OPTIMIZEDROUTE_ID
    FROM cs_rota_read_site
    WHERE routeid IN
      (SELECT ROUTE_ID
      FROM cs_rota_read_route
      WHERE depot_id = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
      )
  AND cs_rota_read_site.optimizedroute_id IS NOT NULL
  ORDER BY CAST(cs_rota_read_site.optimizedroute_id AS NUMERIC(10)) ASC;
  CURSOR c_read_site
  IS
    SELECT base_route_id
    FROM rotaout_audit_details
    WHERE rotaout_audit_details.depotid = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
    AND rotaout_audit_details.flag     IS NULL
	AND rotaout_audit_details.INSTANCE_ID = #SENDOPTIMIZEDROTAOUTTOMWM.VAR_SESSION_ID
    ORDER BY rotaout_audit_details.base_route_id ASC;
  CURSOR c_update
  IS
    SELECT optimized_route_id ,
      base_route_id
    FROM rotaout_audit_details
    WHERE rotaout_audit_details.depotid = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
    AND rotaout_audit_details.flag     IS NULL
	AND rotaout_audit_details.INSTANCE_ID = #SENDOPTIMIZEDROTAOUTTOMWM.VAR_SESSION_ID
    ORDER BY OPTIMIZED_ROUTE_ID ASC ;
  CURSOR c_upd_route
  IS
    SELECT BASE_ROUTE_ID,
      optimized_route_id
    FROM rotaout_audit_details
    WHERE depotid                   = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
    AND optimized_route_id         IS NOT NULL
    AND rotaout_audit_details.flag IS NULL
	AND rotaout_audit_details.INSTANCE_ID = #SENDOPTIMIZEDROTAOUTTOMWM.VAR_SESSION_ID
    ORDER BY base_route_id ASC ;
  CURSOR c_upd_route_1
  IS
    SELECT route_id
    FROM cs_rota_read_route
    WHERE depot_id = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
    ORDER BY route_id ASC;
  CURSOR c_site
  IS
    SELECT rotaout_audit_details.optimized_route_id
    FROM rotaout_audit_details
    WHERE rotaout_audit_details.depotid = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
    AND rotaout_audit_details.flag     IS NULL
	AND rotaout_audit_details.INSTANCE_ID = #SENDOPTIMIZEDROTAOUTTOMWM.VAR_SESSION_ID;
  c1 cs_rota_read_site.optimizedroute_id%type;
  c2 rotaout_audit_details.base_route_id%type;
  c3 cs_rota_read_site.ROUTEID%type;
  c4 cs_rota_read_site.optimizedroute_id%type;
  c5 rotaout_audit_details.base_route_id%type;
  c6 rotaout_audit_details.optimized_route_id%type;
  c7 cs_rota_read_route.route_id%type;
  c8 rotaout_audit_details.optimized_route_id%type;
BEGIN
  OPEN c_read_route;
  OPEN c_read_site;
  LOOP
    FETCH c_read_route INTO c1;
    FETCH c_read_site INTO c2;
    EXIT
  WHEN c_read_route%NOTFOUND or c_read_site%NOTFOUND ;
    UPDATE rotaout_audit_details
    SET rotaout_audit_details.optimized_route_id=c1
    WHERE rotaout_audit_details.base_route_id   =c2
    AND rotaout_audit_details.depotid           = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
    AND rotaout_audit_details.flag             IS NULL
	AND rotaout_audit_details.INSTANCE_ID = #SENDOPTIMIZEDROTAOUTTOMWM.VAR_SESSION_ID;
  END LOOP;
  lv_error:='Error In first Block';
  COMMIT;
  CLOSE c_read_route;
  CLOSE c_read_site;
  OPEN c_site;
  LOOP
    FETCH c_site INTO c8;
    EXIT
  WHEN c_site%NOTFOUND;
    UPDATE rotaout_audit_details
    SET sitecountoptimised =
      (SELECT COUNT(1)
      FROM cs_rota_read_site
      WHERE cs_rota_read_site.optimizedroute_id=c8
      AND ROUTEID                             IN
        (SELECT DISTINCT route_id
        FROM CS_ROTA_READ_ROUTE
        WHERE depot_id =  '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
        )
      )
    WHERE rotaout_audit_details.optimized_route_id=c8
    AND rotaout_audit_details.depotid             = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
    AND rotaout_audit_details.flag               IS NULL
	AND rotaout_audit_details.INSTANCE_ID = #SENDOPTIMIZEDROTAOUTTOMWM.VAR_SESSION_ID;
  END LOOP;
  lv_error:='Error In second Block';
  COMMIT;
  CLOSE c_site;
  OPEN c_update;
  LOOP
    FETCH c_update INTO c3,c4;
    EXIT
  WHEN c_update%NOTFOUND;
    UPDATE CS_ROTA_READ_SITE
    SET CS_ROTA_READ_SITE.OPTIMIZEDROUTE_ID  =c4
    WHERE CS_ROTA_READ_SITE.OPTIMIZEDROUTE_ID=c3
    AND CS_ROTA_READ_SITE.routeid           IN
      (SELECT BASE_ROUTE_ID
      FROM rotaout_audit_details
      WHERE depotid='#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
	  AND rotaout_audit_details.INSTANCE_ID = #SENDOPTIMIZEDROTAOUTTOMWM.VAR_SESSION_ID
      ) ;
  END LOOP;
  lv_error:='Error In Third Block';
  COMMIT;
  CLOSE c_update;
  OPEN c_upd_route;
  LOOP
    FETCH c_upd_route INTO c5,c6;
    EXIT
  WHEN c_upd_route%NOTFOUND;
    UPDATE CS_ROTA_READ_ROUTE
    SET cs_rota_read_route.OPTIMIZED_ROUTEID = c5
    WHERE cs_rota_read_route.route_id        =c5;
  END LOOP;
  lv_error:='Error In fourth Block';
  COMMIT;
  CLOSE C_UPD_ROUTE;
  SELECT SUM(rotaout_audit_details.sitecountbase)
  INTO site_count_base
  FROM rotaout_audit_details
  WHERE rotaout_audit_details.depotid = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
  AND rotaout_audit_details.flag     IS NULL
  AND rotaout_audit_details.INSTANCE_ID = #SENDOPTIMIZEDROTAOUTTOMWM.VAR_SESSION_ID;
  SELECT SUM(rotaout_audit_details.sitecountoptimised)
  INTO site_count_optimized
  FROM rotaout_audit_details
  WHERE rotaout_audit_details.depotid = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
  AND rotaout_audit_details.flag     IS NULL
  AND rotaout_audit_details.INSTANCE_ID = #SENDOPTIMIZEDROTAOUTTOMWM.VAR_SESSION_ID;
  IF site_count_base                 != site_count_optimized THEN
    UPDATE cs_rota_read_site
    SET optimizedroute_id            =routeid
    WHERE cs_rota_read_site.routeid IN
      (SELECT ROUTE_ID
      FROM cs_rota_read_route
      WHERE depot_id = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
      );
    UPDATE cs_rota_read_route
    SET optimized_routeid             =route_id
    WHERE CS_ROTA_READ_ROUTE.depot_id = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT';
    UPDATE rotaout_audit_details
    SET rotaout_audit_details.optimisationstatus='N',
      rotaout_audit_details.bro_flag            ='Y',
      optimized_route_id                        =BASE_ROUTE_ID,
	  FLAG                                      ='F',
      rotaout_audit_details.statusdetails       ='SITE COUNT MISMATCH',
LASTMODIFIEDTIMESTAMP=TO_CHAR(SYSDATE,'YYYY-MM-DD-HH24.MI.SS')
    WHERE rotaout_audit_details.depotid         = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
    AND rotaout_audit_details.flag             IS NULL
	AND rotaout_audit_details.INSTANCE_ID = #SENDOPTIMIZEDROTAOUTTOMWM.VAR_SESSION_ID;
  END IF;
  lv_error :='Error In Fourth Block';
  COMMIT;
  IF site_count_base = site_count_optimized THEN
    UPDATE rotaout_audit_details
    SET rotaout_audit_details.optimisationstatus='Y',
      rotaout_audit_details.bro_flag            ='Y',
      rotaout_audit_details.statusdetails       ='SITE COUNT MATCH',
      USERID                                    ='ODI USER',
      FLAG                                      ='R',
LASTMODIFIEDTIMESTAMP=TO_CHAR(SYSDATE,'YYYY-MM-DD-HH24.MI.SS')
    WHERE rotaout_audit_details.depotid         = '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT'
    AND rotaout_audit_details.flag             IS NULL
	AND rotaout_audit_details.INSTANCE_ID = #SENDOPTIMIZEDROTAOUTTOMWM.VAR_SESSION_ID;
  END IF;
  lv_error := 'Error In Fifth Block';
  COMMIT;
EXCEPTION
WHEN OTHERS THEN
  DBMS_OUTPUT.PUT_LINE('Error while Processing Records Post Raas Process lv_error');
END;

declare
cursor c_OptRoute is select  SITE_ID,OPTIMIZED_ROUTE_ID,SITE_SEQUENCE from staging_rota_site  WHERE DEPOT_ID= '#SENDOPTIMIZEDROTAOUTTOMWM.VAR_RAAS_OPT_DEPOT';
c6 cs_rota_read_site.optimizedroute_id%type;
c5 cs_rota_read_site.siteid%type;
c4 cs_rota_read_site.site_sequence%type;
BEGIN
open c_OptRoute;
LOOP
  fetch c_OptRoute into c5,c6,c4;
  exit when c_OptRoute%NOTFOUND;

  update CS_ROTA_READ_SITE SET cs_rota_read_site.OPTIMIZEDROUTE_ID = c6,cs_rota_read_site.SITE_SEQUENCE = c4
  WHERE cs_rota_read_site.siteid=c5;

  END LOOP;
commit;
  CLOSE c_OptRoute;
END;
